import React, { useState } from 'react';
import styles from './ClubRegister.module.css';

const ClubRegister = () => {
  const [formData, setFormData] = useState({
    cname: '',
    caname: '',
    cpname: '',
    cmail: '',
    cid: '',
    cmobile: '',
    cpassword: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const res = await fetch('http://localhost:3001/api/clubs/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(formData)
      });

      const result = await res.json();
      alert(result.message);

      if (res.ok) {
        window.location.href = '/login-club'; // Navigate to club login page
      }
    } catch (err) {
      console.error('Frontend error:', err);
      alert('Registration failed (Frontend)');
    }
  };

  return (
    <div className={styles.clubRegistrationBody}>
      <div className={styles.clubRegistrationContainer}>
        <h2>Club Registration</h2>
        <form onSubmit={handleSubmit}>
          <div> {/* You might need a specific class for the form if you intend to style it further */}
            <div> {/* You might need a specific class for this section */}
              <span>Details</span> {/* You might need a specific class for the title */}

              <div> {/* You might need a specific class for the fields container */}
                <div className={styles.clubRegistrationContainer__inputGroup}>
                  <label>Club Name</label>
                  <input type="text" name="cname" value={formData.cname} onChange={handleChange} required />
                </div>

                <div className={styles.clubRegistrationContainer__inputGroup}>
                  <label>Advisor Name</label>
                  <input type="text" name="caname" value={formData.caname} onChange={handleChange} required />
                </div>

                <div className={styles.clubRegistrationContainer__inputGroup}>
                  <label>President Name</label>
                  <input type="text" name="cpname" value={formData.cpname} onChange={handleChange} required />
                </div>

                <div className={styles.clubRegistrationContainer__inputGroup}>
                  <label>Club Email</label>
                  <input type="email" name="cmail" value={formData.cmail} onChange={handleChange} required />
                </div>

                <div className={styles.clubRegistrationContainer__inputGroup}>
                  <label>Club ID</label>
                  <input type="number" name="cid" value={formData.cid} onChange={handleChange} required min="10000000" max="99999999" />
                </div>

                <div className={styles.clubRegistrationContainer__inputGroup}>
                  <label>Mobile Number</label>
                  <input type="number" name="cmobile" value={formData.cmobile} onChange={handleChange} required />
                </div>

                <div className={styles.clubRegistrationContainer__inputGroup}>
                  <label>Choose Password</label>
                  <input type="password" name="cpassword" value={formData.cpassword} onChange={handleChange} required />
                </div>
              </div>
            </div>

            <button type="submit" className={styles.clubRegistrationContainer__button}>
              <span>Submit</span> {/* You might need a specific class for the button text */}
            </button>

            <p className={styles.clubRegistrationContainer__register}>
              Back to <a href="/login-club" className={styles.clubRegistrationContainer__a}>Login</a>
            </p>
          </div>
        </form>
      </div>
    </div>
  );
};

export default ClubRegister;
